    public static final int UNEXPECTED_EMPTY_SEGMENT = -11;
    public static final int UNEXPECTED_EMPTY_STATES = -13;
    public static final int VALIDATE_FAILED = -2;
    public static final int VIOLATES_FIRST_IN_PAST = -32;
    public static final int VIOLATES_HARD_LIMIT_ACCEL = -35;
    public static final int VIOLATES_HARD_LIMIT_ALPHA = -37;
    public static final int VIOLATES_HARD_LIMIT_OMEGA = -36;
    public static final int VIOLATES_HARD_LIMIT_VEL = -34;
    public static final int VIOLATES_KEEP_IN = -29;
    public static final int VIOLATES_KEEP_OUT = -28;
